import React from "react";

import "./Header.css";

import logo from "../assets/logo.png";

export default function Header() {
  return (
    <header id="main-header">
      <div className="header-content">
        <img src={logo} alt="AAAGram Logo" />
        <img src={p} alt="Enviar publicação" />
      </div>
    </header>
  );
}
